  [],\n\t\"revision_timestamp\": \"2014-05-09T15:45:26.178689\",\n\t\"name\": \"prevalence-and-characteristics-of-plastic-ingested-by-hawaiian-seabirds\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Production of plastic products and dumping
  of plastic garbage in the ocean have increased dramatically in the past 25 years.
  Plastic ingestion has not been reported as a significant health problem in seabird
  populations, but several studies have indicated negative effects on individual birds.
  To determine the extent of the problem, stomach samples were collected from 18 species
  of seabirds on Kauai, Maui, Nihoa, Tern, Laysan Islands, Pearl and Hermes Reef,
  Midway Atoll, and Johnston Atoll Refuges. Plastic found in the samples was characterized
  by type, volume, and color.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
